import React from "react";
import MenuHamburguer from "./MenuHamburguer";
import Logo from "../assets/images/logo.png"
import "../assets/css/style_login.css";

function MenuLogin() {

    return (
        <>
        <div className="content">
            <div className="conteiner">

                <div className="logo">
                    <img src={Logo} alt="" width="65%"></img>
                </div>

                <div className="menu">

                    <a href="/#">Home</a>
                    <a href="/#">Sobre nós</a>
                    <a href="/#">Contato</a>

                </div>

                <div className="botao">

                    <button className="botao-cadastro"><b>Cadastre-se</b></button>
                </div>

            </div>
            <MenuHamburguer />
            </div>
        </>
    );
};

export default MenuLogin;
